/*
 *  template_preprocess_block()
 *  @param &$vars
*/

function hosting_preprocess_block(&$vars) {
    $block_id = $vars['block']->module . '-' . $vars['block']->delta;
    $region = &$vars['block']->region;
    $classes = &$vars['classes_array'];

    switch ($block_id) {
        case 'block-8':
            if ($region == 'call_us') {
                $classes[] = 'block_postion_top';
            }
            break;

        case 'search-form':
            if ($region == 'search') {
                $classes[] = 'block_top_search';
            }
            break;

        case 'block-27':
            drupal_add_js(path_to_theme() . '/js/jquery.easypiechart.min.js', array('type' => 'file', 'group' => JS_THEME));
            break;
    }

}

/** template_preprocess_page();
 * @param $vars
 */
function hosting_preprocess_page(&$vars) {
    global $theme;
    if (drupal_is_front_page()) {
        unset($vars['page']['content']['system_main']['default_message']);
         //will remove message "no front page content is created"
        drupal_set_title('');
         //removes welcome message (page title)

    }
    if (arg(0) == 'node' && is_numeric(arg(1))) {
        $node = node_load(arg(1));
        if ($node->type == 'themes') {
            $vars['theme_hook_suggestions'][] = 'page__node__themes';
            $vars['nodes'] = $node;
        }
    }
    if(arg(0) == 'contact')
    {
      drupal_add_js('https://maps.googleapis.com/maps/api/js?v=3.exp&amp;sensor=false');
    }

    	$tools_swtich_style = theme_get_setting('tools_swtich_style');
        if ($tools_swtich_style == 1) {
            db_update('block')
                ->fields(array(
                    'status' => 1,
                ))
                ->condition('module', 'mod_quicksettings')
                ->condition('delta', 'mod_quicksettings')
                ->execute();
            cache_clear_all();
        } else if(empty($tools_swtich_style) || $tools_swtich_style == 0) {
            db_update('block')
                ->fields(array(
                    'status' => 0,
                ))
                ->condition('module', 'mod_quicksettings')
                ->condition('delta', 'mod_quicksettings')
                ->execute();
            cache_clear_all();
        }


}

/**
 *  template_preprocess_node();
 * @param $vars
 */
function hosting_preprocess_node(&$vars) {
    $classes = & $vars['classes_array'];
    $node = & $vars;
    if ($vars['type'] == 'news' || $vars['type'] == 'tutorial') {

        $vars['type_media'] = & $vars['field_media_file'][0]['type'];
        if ($vars['view_mode'] == 'full' || $vars['view_mode'] == 'full_width') {
            $classes[] = 'blog-item';
        }

    }
    $user_node = user_load($vars['uid']);
    $introduction = field_view_field('user', $user_node, 'field_introduction_user');
    if(isset($introduction)) {
        $introduction['#label_display'] = 'hidden';

        $vars['introduction'] = render($introduction);
    }
    $vars['author_name'] = isset($user_node->field_fullname_user[LANGUAGE_NONE]) ? $user_node->field_fullname_user[LANGUAGE_NONE][0]['value'] : '';
    $email_user = $user_node->mail;
    $website_user = field_view_field('user', $user_node, 'field_website_user');
    $vars['email_user'] = t('Email:') . '&nbsp;' . l($email_user, 'mailto:' . $email_user);
    if(isset($website_user)) {
        $vars['website_user'] = t('Webiste:') . '&nbsp;' . l($website_user[0]['#markup'], $website_user[0]['#markup']);
    }
}

