/**
 * [domain_finder_preprocess_domain_finder_results description]
 * @param  [type] &$variables [description]
 * @return [type]             [description]
 */

function hosting_preprocess_domain_finder_results(&$variables) {
  // Creating variables to domain-finder-results.tpl.php
  $results = $variables['results'];
  $variables['domain_finder_results_title'] = t('Results of search');
  $variables['domain_finder_results'] = '';
  $variables['domain_finder_search_form'] = drupal_get_form('domain_finder_search_form');
  foreach ($results['exts'] as $result) {
    $variables['domain_finder_results'] .= theme('domain_finder_result', array('result' => $result));
  }
}


/**
 * [domain_finder_preprocess_domain_finder_result description]
 * @param  [type] &$variables [description]
 * @return [type]             [description]
 */
function hosting_preprocess_domain_finder_result(&$variables) {
  // Creating variables to domain-finder-result.tpl.php
  $result = $variables['result'];
  $variables['domain_name'] = check_plain($result['regrinfo']['domain']['name']);
  switch ($result['regrinfo']['registered']) {
    case 'no':
      $variables['domain_attributes'] = 'domain available';
      $variables['output_text'] = '<i class="fa fa-check"></i>'.$variables['domain_name'].' <span>'.t('Available').'</span>';
      break;
    case 'n/a':
      $variables['domain_attributes'] = 'domain not-data';
      $variables['output_text'] = '<i class="fa fa-times"></i>'.$variables['domain_name'].' <span>'.t('Empty result').'</span>';
      break;
    default:
      $variables['domain_attributes'] = 'domain taken';
      $variables['output_text'] = '<i class="fa fa-times"></i>'.$variables['domain_name'].' <span>'.t('Taken').'</span>';
      break;
  }

  // More variables available from:
  // $result['regrinfo']
  // $result['regyinfo']
  // $result['rawdata']
}

