function hosting_preprocess_views_view_unformatted(&$vars) {
    $views = & $vars['view'];
    $classes = & $vars['classes'];
    $rows = & $vars['rows'];
    $attributes = & $vars['attributes'];
    $display_hander = & $vars['view']->display_handler;
    switch ($views->name) {
        case 'themes':
            foreach ($rows as $id => $row) {
                $node = node_load($views->result[$id]->nid);
                $x = 1;
                $term_style = '';
                foreach ($node->field_style_theme[LANGUAGE_NONE] as $key => $value) {
                    $term = $value['taxonomy_term'];
                    if ($x == count($node->field_style_theme[LANGUAGE_NONE])) {
                        $term_style.= $term->name;
                    }
                    else {
                        $term_style.= $term->name . ', ';
                    }
                    $x++;
                }

                $attributes[$id][] = ' data-uk-filter="' . strtolower($term_style) . '" ';
                $vars['attributes_array'][$id] = isset($attributes[$id]) ? implode(' ', $attributes[$id]) : '';
            }

            break;

        case 'faq':
            if ($display_hander->plugin_name == 'page') {
                $y = 1;

                foreach ($rows as $id => $row) {
                    $attributes[$id][] = 'data-uk-filter="aaa"';
                    $vars['attributes_array'][$id] = isset($attributes[$id]) ? implode(' ', $attributes[$id]) : '';
                }
                drupal_add_js('(function($){
                       $(document).ready(function() {
                            $(".view-list-faq .views-row").each(function(index, el) {
            index++;
                              $(this).find(".panel-title a").attr("data-number",index);
          });
                            if($(".view-faq").hasClass("view-list-faq")){
                              $(".view-faq").children(".view-content").attr("id","accordion40");
            $(".view-faq").children(".view-content").addClass("panel-group accordion accordion-faq-number");
                            }
                       });
                    }(jQuery))', array('type' => 'inline', 'scope' => 'footer'));
            }
            break;
    }
}

