/**
 * hook_menu_link_NAM_MENU()
 * @param array $vars
 */
function hosting_menu_link__menu_wordpress_services(array $vars) {

    $element = & $vars['element'];
    $sub_menu = '';

    // array_splice($element['#attributes']['class'],array_search('leaf',$element['#attributes']['class'])); // remove class 'leaf' in menu link
    if ($element['#below']) {

        //$element['#below'][key($element['#below'])]['#attributes']['class'][] = 'my_sub_class';
        $element['#below']['#theme_wrappers'] = array('menu_tree__menu_services_second');

        // $element['#below']['#theme'][] = 'menu_link__menu_services_second';
        $element['#attributes']['class'][] = 'deeper parent';
        $sub_menu = drupal_render($element['#below']);
    }

    $output = '<p><i class="fa fa-angle-right"></i>' . l($element['#title'], $element['#href'], $element['#localized_options']) . '</p>';

    return '<li' . drupal_attributes($element['#attributes']) . '>' . $output . $sub_menu . "</li>\n";
}

function hosting_menu_tree__menu_services_second(&$vars) {

    return '<div class="divsubmenu"><ul>' . $vars['tree'] . '</ul></div>';
}

